        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Les réseaux informatiques constituent un secteur économique important de notre pays, générateur d’emplois hautement qualifiés. L'activité des
                    opérateurs et des PME se concentre autour des développements informatiques : réseaux, internet des objets, cloud, ToIP, streaming vidéo... Les
                    réseaux informatiques s'appuient fortement sur les réseaux de télécommunications dont le rapide développement est dû à l'innovation p");
            WriteLiteral(@"erpétuelle
                    dans ce domaine (GSM, ADSL, TNT, WIFI...). La technologie physique étant arrivée à maturité, le marché de l'emploi est aujourd'hui tourné
                    vers l'architecture des réseaux, la sécurité et le développement de solution Internet of Things (IoT), domaines ciblés par la formation.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    L’objectif du Master Professionnel Ingénierie des Systemes de Telecommunication et Reseaux (STR) est de former en 2 ans des cadres ayant une
                    réelle maîtrise technologique ainsi que de réelles aptitudes à prendre en compte l’environnement économique, social et humain pour pouvoir
                    assurer un Management du secteur des Réseaux & Télécoms intégrant les");
            WriteLiteral(@" Systèmes d’Informations de l’entreprise étendue dans sa globalité.
                    La pluridisciplinarité technologique permet aux étudiants en ingénierie STR de répondre à un réel besoin des entreprises de fédération de services
                    au départ très cloisonnés.Les entreprises intéressées par ces profils sont les sociétés de services, les opérateurs de télécoms, les intégrateurs et les grands utilisateurs des
                    Systèmes d’Information et des Télécoms.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    Le master permet d'acquérir des connaissances de haut niveau dans le domaine de l'architecture et la sécurité des réseaux étendus ainsi que dans
                    l'internet des objets. Le Cloud Computing, le Stockage, la ToIP, la Virtualisation, la Sécurité, la Qualité de Service, le M2M, l");
            WriteLiteral(@"e Développement
                    Embarqué sont au cœur de la formation. Enfin, les programmes ont été conçus afin de donner également aux étudiants les connaissances en
                    télécommunications qu'un cadre dans le domaine des télécommunications doit maîtriser.
                </p>


                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    Le programme dure 1 an ou 2 ans selon le niveau d'entrée. Il prépare au parcours unique d’ingénieur des systèmes de télécommunications et
                    réseaux.
                </p>

            </div>

        </figure>

